"use strict";function getqsv(e){for(var n=window.location.search.substring(1),t=n.split("&"),i=0;i<t.length;i++){var a=t[i].split("=");if(a[0]==e)return a[1]}return null}function updateqs(e,n){var t=window.location.search.substring(1);t.search(new RegExp(e+"=.*&"))>=0?t=t.replace(new RegExp(e+"=.*&"),e+"="+n+"&"):t.search(new RegExp(e+"=.*$"))>=0?t=t.replace(new RegExp(e+"=.*$"),e+"="+n):t+=(""===t?"":"&")+e+"="+n;var i="?"+t;history.replaceState(null,null,i)}function init_readme_btn(){init_btn("readme-btn","readme")}function init_change_log_btn(){init_btn("changes-btn","changes")}function init_btn(e,n){var t=window.document.getElementById(e);t.addEventListener("click",function(){this.classList.toggle("active");var e=window.document.getElementById(n);e.style.maxHeight=e.style.maxHeight?null:"none",updateqs(n,e.style.maxHeight?"visible":"hidden")});var i=getqsv(n);null===i?updateqs(n,"hidden"):"visible"===i&&t.click.apply(t)}